package operators1;

public class Autoincrementautodecrement {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int m = 10;
		int n = 50;
		
		// m = m + 1
		m++; 
		// n = n - 1
		n--;
		System.out.println("Output of m + 1 is "+ m);
		System.out.println("Output of n - 1 is "+ n);
	}

}
